import React, { useState } from 'react';
import { IonButton, IonButtons, IonCard, IonCol, IonContent, IonHeader, IonInput, IonItemDivider, IonList, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab2.css';
import { RouteComponentProps } from 'react-router';

const Tab2: React.FC<RouteComponentProps> = (props) => {

  const [text, setText] = useState<string>();

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Explore</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonItemDivider>
          <IonInput value={text} placeholder="Search Clubs" onIonChange={e => setText(e.detail.value!)}></IonInput>
          <IonButton>Filter</IonButton>
        </IonItemDivider>
        <IonList>
          <IonCol>
            <IonCard>
              Club 1
            </IonCard>
          </IonCol>
          <IonCol>
            <IonCard>
              Club 2
            </IonCard>
          </IonCol>
        </IonList>
      </IonContent>
    </IonPage>
  );
};

export default Tab2;
